  false,\n\t\"url\": null,\n\t\"notes\": \"Data depicts the locations of three historic
  canals in Indiana, the Wabash-Erie Canal, White Water Canal and the Central Canal.
  These canals were constructed and used for transportation between 1830-1870. Canal
  historians have searched county courthouse records and archived state engineering
  reports to plot canal routes on USGS 7.5 minute quadrangles. Some portions of the
  canal routes are unknown and approximated as indicated in the table. In many locations
  canals have been filled in and covered by development. is collected only from southern
  Indiana border through Vigo and Marion counties.\",\n\t\"license_title\": null,\n\t\"extras\":
